    id
    contractAddress
    aminalIndex
    parentOne {
      id
      contractAddress
      aminalIndex
    }
    parentTwo {
      id
      contractAddress
      aminalIndex
    }
    energy
    totalLove
    ethBalance
    blockTimestamp
    tokenURI
